import React from 'react';

import {
    
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    NavbarText
  } from 'reactstrap';


const DropDown = ({genres}) =>{
    return (
        <UncontrolledDropdown nav inNavbar>
              <DropdownToggle nav caret>
               Genre
              </DropdownToggle>
              <DropdownMenu right>
                <DropdownItem>
                  {genres.name}
                </DropdownItem>
                <DropdownItem>
                  Option 2
                </DropdownItem>
                
              </DropdownMenu>
            </UncontrolledDropdown>
        )
    }


export default DropDown;
